import React from "react";
import ReactLogo from "../Components/ReactLogo";
import "../App.css";
import { ImLinkedin, ImGithub } from "react-icons/im";

export default function Header({ pageIndex, setPageIndex }) {
  const links = ["About", "Testimonial", "Services", "Projects", "Contact"];
  return (
    <div className="header">
      <div
        style={{
          flex: 1,
          fontWeight: 600,
          fontSize: 40,
          display: "flex",
          alignItems: "center",
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <ReactLogo />
        </div>
        <div>
          <div style={{ height: 35 }}>erik</div>
          <div>larsson</div>
        </div>
      </div>
      {links.map((link, i) => {
        return (
          <div
            className={
              pageIndex === i
                ? "header-link header-link-active"
                : "header-link header-link-default"
            }
            onClick={() => setPageIndex(i)}
          >
            {link}
          </div>
        );
      })}
      <div
        style={{
          flex: 1,
          display: "flex",
          justifyContent: "flex-end",
          alignItems: "center",
          fontSize: 40,
        }}
      >
        <a className="iconLink">
          <ImLinkedin />
        </a>
        <a className="iconLink">
          <ImGithub />
        </a>
      </div>
    </div>
  );
}
